import React from 'react';
import DetailsButton from '../../components/DetailsButton/DetailsButton';
import bookImage from '../../images/book1.jpg';
import LikeButton from '../../components/LikeButton/LikeButton';
import './HomePage.scss';

const homePage = () => {
  return (
    <section className="section">
      <h3 className="section__title"> New arrivals</h3>
      <div className="section__books">
        <div className="section__singleBook card">
          <img src={bookImage} alt="the book" className="card__image" />
          <div className="card__body">
            <h3 className="card__title">Title of the book</h3>
            <small className="card__author">Author name</small>
            <p className="card__price">$5</p>
            <div className="card__buttons">
              <DetailsButton />
              <LikeButton />
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default homePage;
